import React from "react";
import "./Shared.css";
import "./Privacy.css";
import "./Footer.css";
import { Footer } from "./Footer";


export const Privacy: React.FC = () => {
    return (
        <div>
          <div className="header privacy-header">
            <div className="overlay"></div>
            <div className="ingress">
              <h1 className="white">Walls have ears.</h1>
            </div>
          </div>

          <div className="main">
            <h2>

            </h2>
            <p>
              We have strong views on privacy when it comes to our own data. We believe our data is valuable, and treat it with the encryption it deserves.
            </p>
            <p>
              And we promise to treat your data equally well. If you decide to 'Send us your data', you can rest assured that we keep it as safe, and andonymous as possible. There is a worrying trend within the startup community to treat customer data as a resource to be harvested, and as a primary source of income. At Mother. we would prefer to make our money delivering novel and powerful mental health tools, and so we promise to never exploit your data.
            </p>
            <p>
              If you decide to send us your data, we promise to use it only to improve our services, to study how effective our tools are and to develop them further. The closest we want to see our customers profiles, is as little dots in the data behind graphs that look like this.
            </p>
            <img src="./images/privacy-data.png" width="300" className="one" />

            <Footer />
          </div>
        </div>
    );
};
